import React, { useEffect } from "react"
import { useSelector, useDispatch } from "react-redux"
import ShopPage from "./shop-page-style"
import { selectShopCollectionsMap } from "../../redux/shop/shop.selectors"
import { fetchCollectionsStart } from "../../redux/shop/shop.actions"
import CollectionItem from "../../component/collection-Item/CollectionItem"

const ShopPageComponent = () => {
    const collections = useSelector(state => selectShopCollectionsMap(state))
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(fetchCollectionsStart())
    }, [])

    return <ShopPage>
        {collections.map(collection => <CollectionItem object={collection} />)}
    </ShopPage>
}
export default ShopPageComponent
